  ngOnInit() {
    this.meals = [];
    this.meals.push({ label: "Breakfast", value: MealType.breakfast });
    this.meals.push({ label: "Lunch", value: MealType.lunch });
    this.meals.push({ label: "Dinner", value: MealType.dinner });
    this.meals.push({ label: "Snacks", value: MealType.snack });

    this.foodSearchForm = this.fb.group({
      searchText: ['', [Validators.required]]
    });

    this.foodAddForm = this.fb.group({
      quantity: ['', [Validators.required, ValidationService.numberFieldValidator]],
      unit: [''],
      meal: ['']
    });

    this.selectedMeal = MealType.breakfast;
    this.selectedFood = new DailyFoodItem();

    this.foodAddForm.valueChanges
      .map((value) => { return value; })
      .subscribe((value) => {
        this.selectedFood.quantity = this.foodAddForm.value.quantity;
        this.selectedFood.unit = this.foodAddForm.value.unit;
        this.selectedFood.meal = this.foodAddForm.value.meal;
        console.log(value.toString());
      })
  }

  onAddFoodSubmit() {
    this.selectedFood.calcium = this.selectedRow.nf_calcium_dv;
    this.selectedFood.id = this.selectedRow.item_id;
    this.selectedFood.quantity = this.foodAddForm.value.quantity;
    this.selectedFood.unit = this.foodAddForm.value.unit;
    this.selectedFood.meal = this.foodAddForm.value.meal;
    this.selectedFood.name = this.selectedRow.item_name;
    this.selectedFood.calories = this.selectedRow.nf_calories;
    this.selectedFood.carbs = this.selectedRow.nf_total_carbohydrate;
    this.selectedFood.protein = this.selectedRow.nf_protein;
    this.selectedFood.fat = this.selectedRow.nf_total_fat;
    this.selectedFood.sodium = this.selectedRow.nf_sodium;
    this.selectedFood.fiber = this.selectedRow.nf_dietary_fiber;
    this.selectedFood.satFat = this.selectedRow.nf_saturated_fat;
    this.selectedFood.monoFat = this.selectedRow.nf_monounsaturated_fat;
    this.selectedFood.polyFat = this.selectedRow.nf_polyunsaturated_fat;
    this.selectedFood.transFat = this.selectedRow.nf_trans_fatty_acid;
    this.selectedFood.cholesterol = this.selectedRow.nf_cholesterol;
    this.selectedFood.sugars = this.selectedRow.nf_sugars;
    this.selectedFood.vitA = this.selectedRow.nf_vitamin_a_dv;
    this.selectedFood.vitC = this.selectedRow.nf_vitamin_c_dv;
    this.selectedFood.calcium = this.selectedRow.nf_calcium_dv;
    this.selectedFood.iron = this.selectedRow.nf_iron_dv;
    this.selectedFood.potassium = this.selectedRow.nf_potassium;
    this.selectedFood.processed = false;

    this.fs.addFoodToUser(this.selectedFood);

   

    this.r.navigate(['/diary']);
  }



